import React from "react";
import Button from "@material-ui/core/Button";
import Container from "@material-ui/core/Container";
import TextField from "@material-ui/core/TextField";
import styled from "styled-components";
import Card from "../Card/Card";
import Header from "../Header/Header";
import Misc from "../../hoc/Misc/Misc";
import Select from "../Select/Select";
import Input from "../Input/Input";
import "./Home.css";
import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles({
  container: {
    display: "flex",
    flexDirection: "row",
    alignItems: "center",
    justifyContent: "center"
  }
});

type MyProps = {
  message?: string;
};

const StyledButton = styled(Button)`
  margin: 0 .5rem;
`;

const MuiTextField = styled(TextField)`
  margin: 0 0 1rem 0;
  width: 25%;

  @media only screen and (max-width: 645px) {
    width: 100%
  }
`;

function Home() {
  const classes = useStyles();

  return (
    <Misc>
      <Header />
      <Container className={classes.container}>
        {/* <StyledButton variant="contained" color="primary">Save</StyledButton>
        <StyledButton variant="contained" color="secondary">Flip</StyledButton> */}
        <Input />
        <Select />
      </Container>
      <Card word={"همه کاره"} lang={"Persian"} type={"adj."}></Card>
    </Misc>
  );
}

export default Home;
